import React from "react";


const Counter = () => {
    const state = {
        count: 0,
        tags: ["tag1", "tag2", "tag3"]
    };



    return (
        <>
            <ul>{state.tags.map(tag => <li key={tag}>{tag}</li>)}</ul>
        </>
    )
}


export default Counter;
